description:
Set Software Auto Clicker Complect 7 includes 7 Modification of this product:
1. AutoClicker One (clicks on the screen with the stored coordinate indicates the frequency of clicks);
2. AutoClicker Image (clicks on the screen coordinates stored by comparing and matching screens around the coordinates of a target frequency clicks);
3. AutoClicker Image List (clicks on memorized the coordinates of the monitor by comparing and matching screens around the coordinates of a target frequency clicks);
4. AutoClicker Matrix (Matrix produces clicks within 1 ms. In the specified user box on the screen);
5. AutoClicker Game (programs clicking one of three types according to the mouse cursor key is pressed during a speed higher than 1000 or less clicks per second);
6. AutoClicker Game List (programs with one click of the mouse the three types of horizontal, vertical, slanted, 20-pixel matrix and the matrix 10 pixels within 1 ms.)
7. AutoClicker List (clicks on the screen coordinates of the memorized list).
